import React, {useState, useEffect} from 'react';

 const App = () => {

  const [num, setnum] = useState(0);

  useEffect(()=>{
     document.title= `youclick me ${num} times`;
  })
   return (
      <>
         <button onClick={()=>{
             setnum(num + 1)
         }} >
            Click Me {num}
         </button>
      </>
   )
}

 export default App;
